// 左旋操作
private void leftRotate(RBNode x) {
    RBNode y = x.right;
    // 将y左节点作为x的右节点
    x.right = y.left;
    if (y.left != null) {
        y.left.parent = x;
    }

    // 用y替掉x，如果x是根节点，维护y为根节点
    y.parent = x.parent;
    if (x.parent == null) {
        this.root = y;
    } else {
        if (x.parent.left == x) {
            x.parent.left = y;
        } else {
            x.parent.right = y;
        }
    }

    // 将 x设为y的左子节点
    y.left = x;
    x.parent = y;
}

